/* eslint-disable react/display-name */
import React, { useState, forwardRef } from 'react';
import clsx from 'clsx';
import PropTypes from 'prop-types';
import moment from 'moment';
import uuid from 'uuid/v1';
import { makeStyles } from '@material-ui/styles';
import {
  Card,
  CardContent,
  CardActions,
  Typography,
  TextField,
  Button,
  IconButton,
  Divider,
  colors,

} from '@material-ui/core';
import DeleteIcon from '@material-ui/icons/DeleteOutlined';
import Autocomplete from '@mui/material/Autocomplete';


const useStyles = makeStyles(theme => ({
  root: {
    position: 'absolute',
    top: '50%',
    left: '50%',
    transform: 'translate(-50%, -50%)',
    outline: 'none',
    boxShadow: theme.shadows[20],
    width: 700,
    maxHeight: '100%',
    overflowY: 'auto',
    maxWidth: '100%'
  },
  field: {
    marginTop: theme.spacing(3)
  },
  cancelButton: {
    marginLeft: 'auto'
  },
  confirmButton: {
    color: theme.palette.white,
    backgroundColor: colors.green[600],
    '&:hover': {
      backgroundColor: colors.green[900]
    }
  }
}));

const AddDesignation = forwardRef((props, ref) => {
  const {
    accessLevel,
    event,
    onDelete,
    onCancel,
    onAdd,
    onEdit,
    className,
    ...rest
  } = props;

  const classes = useStyles();

  const defaultEvent = {
    designation_name: '',
    level_id: '',
    level_name: '',
    description: '',

  };



  const options = [
    'Resend last invoice',
    'Send password reset',
    'Send verification',
    'Resend last invoice',
    'Send password reset',
    'Send verification'
  ]; 

  const top100Films = [
    { label: 'The Shawshank Redemption', year: 1994 },
    { label: 'The Godfather', year: 1972 },
    { label: 'The Godfather: Part II', year: 1974 },
    { label: 'The Dark Knight', year: 2008 },
    { label: '12 Angry Men', year: 1957 },
    { label: "Schindler's List", year: 1993 },
    { label: 'Pulp Fiction', year: 1994 },


  ];

  //const options = accessLevel;

  const [values, setValues] = useState(event || defaultEvent);

  const [option, setOption] = useState(options[0]);

  const [selectedOptions, setSelectedOptions] = useState([]);

  const defaultValue = accessLevel;

  const [value, setValue] = useState(defaultValue);




  const handleChange = event => {
    event.persist();

    setOption(event.target.value);
  };

  const mode = event ? 'edit' : 'add';

  const handleFieldChange = e => {
    e.persist();
    setValues(values => ({
      ...values,
      [e.target.name]:
        e.target.type === 'checkbox' ? e.target.checked : e.target.value
    }));
  };

  const handleDelete = () => {
    onDelete && onDelete(event);
  };

  const handleAdd = () => {
    console.log('the values are ', value)
    if (!values.level_name || !values.description ) {
      return;
    }



    onAdd({ ...values });
  };

  const handleEdit = () => {
    if (!values.level_name || !values.description) {
      return;
    }

    onEdit(...Cardvalues);
  };

  //const selectedAutoItem = (event, value) =>setSelectedOptions(value);

  const defaultProps = {
    options: top100Films,
    getOptionLabel: (option) => option.level_name,
  };


  return (
    <Card
      {...rest}
      className={clsx(classes.root, className)}
      ref={ref}
    >
      <form>
        <CardContent>
          <Typography
            align="center"
            gutterBottom
            variant="h3"
          >
            {mode === 'add' ? 'Add Event' : 'Edit Event'}
          </Typography>
          <TextField
            className={classes.field}
            fullWidth
            label="Designarion Name"
            name="designation_name"
            onChange={handleFieldChange}
            value={values.designation_name}
            variant="outlined"
          />

          <Autocomplete
            className={classes.field}
            fullWidth
            id="combo-box-demo"
            {...defaultProps}
            defaultValue={defaultValue}
            renderInput={(params) => <TextField {...params} level_name="Movie"   variant="outlined"/>}
            onChange={(event, newValue) => {
              console.log(newValue);
              setValue(newValue);
            }}


          />
          <p>Selected Country - {value?.title} </p>
          <TextField
            className={classes.field}
            fullWidth
            label="Description"
            name="description"
            onChange={handleFieldChange}
            value={values.description}
            variant="outlined"
          />



        </CardContent>
        <Divider />
        <CardActions>
          <IconButton
            edge="start"
            onClick={handleDelete}
          >
            <DeleteIcon />
          </IconButton>
          <Button
            className={classes.cancelButton}
            onClick={onCancel}
            variant="contained"
          >
            Cancel
          </Button>
          {mode === 'add' ? (
            <Button
              className={classes.confirmButton}
              onClick={handleAdd}
              variant="contained"
            >
              Add
            </Button>
          ) : (
            <Button
              className={classes.confirmButton}
              onClick={handleEdit}
              variant="contained"
            >
              Save
            </Button>
          )}
        </CardActions>
      </form>
    </Card>
  );
});

AddDesignation.propTypes = {
  className: PropTypes.string,
  event: PropTypes.object,
  onAdd: PropTypes.func,
  onCancel: PropTypes.func,
  onDelete: PropTypes.func,
  onEdit: PropTypes.func
};

export default AddDesignation;
